import sys

n = int(sys.stdin.readline())

def gcd(a, b):
    while b:
        a, b = b, a % b
    return a

def f(p):
    return len(set([gcd(p[i], p[j]) for i in range(len(p)) for j in range(i + 1, len(p))]))

def f_max(n):
    return max([f(p) for p in permutations(range(1, n + 1))])

ans = 0
for p in permutations(range(1, n + 1)):
    if f(p) == f_max(n):
        ans += 1

print(ans % 1000000007)

import sys

n = int(sys.stdin.readline().strip())

def gcd(a, b):
    if b == 0:
        return a
    else:
        return gcd(b, a % b)

def f(p):
    g = [gcd(p[i], p[i + 1]) for i in range(len(p) - 1)]
    g.append(gcd(p[-1], p[0]))
    return len(set(g))

ans = 0
for p in permutations(range(1, n + 1)):
    if f(p) == f(range(1, n + 1)):
        ans += 1

print(ans % 1000000007)

